import React, { useState } from 'react';
import './HowItWorks.css';
import Navbar from './Navbar';
import Footer from './Footer';

const HowItWorks = () => {
  const [selectedCard, setSelectedCard] = useState(null);

  const cards = [
    {
      id: 1,
      title: 'Marina Bay Financial Centre',
      address: '10 Marina Boulevard, Singapore',
      type: 'Commercial',
      floors: 50,
      sqft: 3000000,
      image: "http://localhost:3845/assets/18a9ad6ae180db6222a9dcede882f38c4f7381ca.png"
    },
    {
      id: 2,
      title: 'Jurong Industrial Estate',
      address: 'Jurong Island, Singapore',
      type: 'Industrial',
      floors: 8,
      sqft: 500000,
      image: "http://localhost:3845/assets/06856c49ec8fb21c90f1c5314db6486439c2d337.png"
    },
    {
      id: 3,
      title: 'Orchard Gateway',
      address: '277 Orchard Road, Singapore',
      type: 'Commercial',
      floors: 20,
      sqft: 800000,
      image: "http://localhost:3845/assets/a5567c835d14932dd61d89cbe49bba188ddf51a4.png"
    },
    {
      id: 4,
      title: 'Tuas Industrial Park',
      address: 'Tuas South, Singapore',
      type: 'Industrial',
      floors: 12,
      sqft: 1200000,
      image: "http://localhost:3845/assets/e0b84b558653fc6e03589419db65a3819146775f.png"
    }
  ];

  return (
    <div className="howitworks-page">
      <Navbar />

      {/* Main Content Section with Header and Cards */}
      <section className="how-main">
        <div className="how-header">
          <h1 className="section-title">See How it Works</h1>
          <p className="section-subtitle">
            Explore our platform with real Singapore commercial and industrial property examples
          </p>
        </div>

        {/* Card Grid */}
        <div className="how-grid">
          {cards.map(card => (
            <article className="how-card" key={card.id}>
              <div className="how-card-image" style={{ backgroundImage: `url('${card.image}')` }} />
              <div className="how-card-body">
                <div className="card-type-badge">{card.type}</div>
                <h3>{card.title}</h3>
                <p className="muted">{card.address}</p>
                <div className="how-meta">
                  <span>üè¢ {card.floors} Floors</span>
                  <span>üìè {card.sqft.toLocaleString()} sqft</span>
                </div>
                <button
                  className="btn btn-secondary"
                  onClick={() => setSelectedCard(card.id)}
                >
                  View Details
                </button>
              </div>
            </article>
          ))}
        </div>

        {/* Detail Container Underneath */}
        {selectedCard && (
          <div className="how-details">
            {(() => {
              const card = cards.find(c => c.id === selectedCard);
              return (
                <div className="details-card">
                  <div className="details-header">
                    <h2>{card.title}</h2>
                    <button 
                      className="close-btn"
                      onClick={() => setSelectedCard(null)}
                    >
                      ‚úï
                    </button>
                  </div>
                  <div className="details-content">
                    <img src={card.image} alt={card.title} className="details-img" />
                    <div className="details-info">
                      <p className="details-address">{card.address}</p>
                      <div className="details-meta">
                        <div className="meta-item">
                          <span className="meta-label">Property Type:</span>
                          <span className="meta-value">{card.type}</span>
                        </div>
                        <div className="meta-item">
                          <span className="meta-label">Floors:</span>
                          <span className="meta-value">{card.floors}</span>
                        </div>
                        <div className="meta-item">
                          <span className="meta-label">Floor Area:</span>
                          <span className="meta-value">{card.sqft.toLocaleString()} sqft</span>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              );
            })()}
          </div>
        )}
      </section>

      <Footer />
    </div>
  );
};

export default HowItWorks;
